USERTRAINCODE.Data:
data EMWS2.EMCODE_TRAIN;
    set EMWS2.FIMPORT_train;

    /* Check if the record is a bad record (Class == 1) */
    if class = 1 then do;

        /* Duplicate the bad record 10 times */
        do i = 1 to 25;
            output;
        end;

    end;

    /* Output good records as is */
    else output;

    drop i;
run;

